    false,nt"url": null,nt"notes": "This narrative report for Seney National
    Wildlife Refuge outlines Refuge accomplishments from August through October of 1939.
    The report begins by summarizing the weather conditions, water conditions, and Refuge
    finances during this period. Wildlife- including migratory birds, upland game birds,
    furbearers, predators, rodents, and mammals- is also covered. Resource management
    is outlined; topics include fur harvesting. A list of Refuge visitors is included.
